import styled from "styled-components";

const HeaderStyled = styled.header`
  display: flex;
  align-items: center;
  justify-content: space-around;
  background-color: #f5f6fa;
  height: 4em;
  border-bottom: 1px solid #dcdde1;
`;

export default HeaderStyled;
